2:40:00 oop, that was an embarrassing and unnecessary SC I sent then if you've already got a good chair! ;A; 

Either way, self-care also counts in a chair you'll have for a LONG TIME. Take care to watch out for burnout!!

oh, and exercise is SO important!!! ;A; 
that and trying to keep a somewhat lighter grip on the controller helps too. I used to grip my controller fairly hard when I was playing Dark Souls 3 for super long sessions and my left wrist was feeling all kinds of out of sorts. I stopped after finishing the game, but after I asked my pcp about it and how it happened, he mentioned that gripping something too hard for too long and/or having a bad posture can really mess up your wrists. I think that's all I wanted to say...anyway! Thanks for reading my SC and I hope you have a good day!!
